import React from 'react';
import Calculate from './calculate';

class TableRow extends React.Component {

    constructor(props) {
        super(props);
        this.state = {type1: '0', type2: '0'}

        this.handleChange = this.handleChange.bind(this)
        // this.handleSubmit = this.handleSubmit.bind(this)
    }

    handleChange(event) {
        this.setState({
            ...this.state,
            [event.target.name]: event.target.value
        });
    }

    render() {
        return (
                    <tr>
                    <td>
                            <select name="type1" value={this.state.type1} className="form-select-sm me-1" aria-label=".form-select-sm" onChange={this.handleChange}>
                                <option value="0">None</option>
                                <option value="1">Normal</option>
                                <option value="2">Fire</option>
                                <option value="3">Water</option>
                                <option value="4">Electric</option>
                                <option value="5">Grass</option>
                                <option value="6">Ice</option>
                                <option value="7">Fighting</option>
                                <option value="8">Poison</option>
                                <option value="9">Ground</option>
                                <option value="10">Flying</option>
                                <option value="11">Psychic</option>
                                <option value="12">Bug</option>
                                <option value="13">Rock</option>
                                <option value="14">Ghost</option>
                                <option value="15">Dragon</option>
                                <option value="16">Dark</option>
                                <option value="17">Steel</option>
                                <option value="18">Fairy</option>
                            </select>
                            <select name="type2" value={this.state.type2} className="form-select-sm" aria-label=".form-select-sm" onChange={this.handleChange}>
                                <option value="0">None</option>
                                <option value="1">Normal</option>
                                <option value="2">Fire</option>
                                <option value="3">Water</option>
                                <option value="4">Electric</option>
                                <option value="5">Grass</option>
                                <option value="6">Ice</option>
                                <option value="7">Fighting</option>
                                <option value="8">Poison</option>
                                <option value="9">Ground</option>
                                <option value="10">Flying</option>
                                <option value="11">Psychic</option>
                                <option value="12">Bug</option>
                                <option value="13">Rock</option>
                                <option value="14">Ghost</option>
                                <option value="15">Dragon</option>
                                <option value="16">Dark</option>
                                <option value="17">Steel</option>
                                <option value="18">Fairy</option>
                            </select>
                    </td>
                    <td>Ground, Water, Grass</td>
                    <td>Fire, Ghost</td>
                    </tr>
        );
    }
};

export default TableRow;
